測定しようとするトルク値をあらかじめ設定できるので、連続して<br>
作業を行う場合や目盛りの読み取りが困難場所で使用する時に<br>
効果を発揮します。<br><br>

●精　度<br> 
・独自のプレセット機構ですので、測定トルク値の設定は端数値まで正確かつ容易に<br>
　 行なえます。<br>
・測定値設定後のロック機能付です。<br><br> 

●使いやすさ<br> 
・設定トルクの変更は、ロックリングを指で引き下げグリップを回すだけの簡単操作。<br>
・設定トルクに達すると手への軽いショックと共にヘッドの角度が変わり、締付け完了<br>
　 が確認できます。目盛りが読めない作業箇所で効果を発揮します。<br>
・右トルクだけでなく、左トルクの測定作業も可能です。<br>
・グリップ形状は、握り感が良く、耐久性に優れた材質を採用した新しいデザインです。<br><br>

●耐久性<br> 
・ラチェットヘッドは耐久性に優れた小判形ヘッド（歯数36枚）を採用。ソケットが外れ<br>
　 ないユニオン機構付きです。<br>
・ヘッド部首元にゴムリングにより密閉度が高くなった為、故障の原因が少なく高精度<br>
　 が保てます。<br>
・保管に便利な丈夫な樹脂ケース入りです。<br>
・ラチェットヘッド部はリペアキットを設定しています。（CMPB0504、1004を除く）<br>
※リペアキットを使用された場合は校正及び調整されることをお勧めします。<br><br>


■仕様<br>
【トルク測定範囲(左・右)(N・m)】：10～50<br>
【最小目盛(N・m)】：0.5<br>
【差込角(mm)】：9.50<br>
【ヘッド幅(mm)】：33.0<br>
【ヘッド厚(mm)】：13.5<br>
【全長(mm)】：337 <br>
【重量】：0.8kg<br>
【主な用途・向け先】：二輪車等、全般に幅広く使用できます。<br><br>

■補給部品(リペアキット)<br>
BR3E-Kk<br>

※測定目盛はN・mスケールのみです。(簡易換算式：1kgf・m≒10N・m 1N・m≒0.1kgf・m)<br><br>

■注意<br>
・「カチッ」と音がしたり手に軽いショックを受けたらそれ以上負荷をかけないでください。<br>
・ボルト・ナットの緩めには使用しないで下さい。<br>
・保管時には設定トルクを最低値にして下さい。<br><br>


≪ 一覧 ≫ <br><br>
小型部品等の小トルクの連続締付けに有効: CMPB0152 <br><br>
小型エンジン等に最適: CMPB0253<br><br>
二輪車等、全般に幅広く使用 : CMPB0503<br><br>
9.5sq.の標準タイプ : CMPB1003 <br><br>
12.7sq.のコンパクトで使いやすいタイプ: CMPB0504 <br><br>
12.7sq.で乗用車エンジン・シャーシ等に使いやすいタイプ: CMPB1004 <br><br>
乗用車のホイールナットにジャストフィットします: CMPB2004 <br><br>
12.7sq.で幅広いトルクレンジをカバーします: CMPB3004 <br><br>
大型車や建築・建設機械等に最適: CMPB8008 <br><br>
大型車や建築・建設機械等に最適: CMPB8006 <br><br>
