特徴<br> 
●測定しようとするトルク値を予め設定できるので、連続して作業を行う場合や、<br>
目盛り読み取りが困難な場合で使用する時に効果を発揮。<br><br>

●測定値設定後のロック機構付き。<br><br>

●右トルクだけでなく、左トルクの設定作業可能。<br><br>

●ヘッド幅が小さく、従来では入らなかった場所に使用できます。<br><br>

●ギア数は36枚（送角10°）と細かく狭い場所での作業が可能です。<br><br> 

用途 <br>
●小型エンジン、一般的な締め付け作業に最適です！<br><br> 

仕様<br> 
●トルク測定範囲(左・右)(N・m)：5～25<br>
●最小目盛(N・m)：0.1<br>
●差込角(mm)：9.50<br>
●ヘッド幅(mm)：22.0<br>
●ヘッド厚(mm)：10.0<br>
●全長(mm)：235 <br><br>

【質量】： 0.3ｋｇ<br><br> 

